


// pasar imagenes a base64
var fondoCertificado =
  "data:image/png;base64,";

var firmaCapactador =
  "data:image/png;base64,";








let descripcionCurso = "Diseo y dimensionamiento de la infraestructura de soporte para el cumplimiento del Reglamento para redes internas de telecomunicaciones RITEL de acuerdo con la resolucin 5993 de 2020";
        
let duracionCurso = "El curso tuvo una duracin de treinta y cinco (35) horas, dictado en Febrero de 2022";
  
let nombreCapacitador = "Ing. Marcos Quintana";


let selectedFile;
//console.log(window.XLSX);
document.getElementById("importarExcel").addEventListener("change", (event) => {
  selectedFile = event.target.files[0];
});

let data = [
  {
    name: "jayanth",
    data: "scd",
    abc: "sdef",
  },
];



const botonConvertir = document.getElementById("convertirExcelAJs");
botonConvertir.addEventListener("click", (evento) => {

  // Array de objetos donde se guardara la informacion de cada persona
  let datosPersona = [];


  XLSX.utils.json_to_sheet(data, "out.xlsx");

  if (selectedFile) {
    let fileReader = new FileReader();
    fileReader.readAsBinaryString(selectedFile);

    fileReader.onload = (event) => {
      let data = event.target.result;
      let workbook = XLSX.read(data, { type: "binary" });
      
      workbook.SheetNames.forEach((sheet) => {
        datosPersona = XLSX.utils.sheet_to_row_object_array(workbook.Sheets[sheet]);
      });
      


      // trabajar de aqui hacia abajo , que es visible el archivo lectura
      
      // verificacion del correcto funcionamiento e la consola
      console.log(datosPersona);


      const generarCertificado = document.querySelector("#generarCertificado");
      generarCertificado.addEventListener("click", generacionCertificado);

      function generacionCertificado() {
        let cajaFila = document.querySelector(".certificadoCreado");
        cajaFila.innerHTML = ``;

        function crearCaja(nombre,documento) {
          let cajaFila = document.querySelector(".certificadoCreado");
          const templateCaja = `<section class="certificado">
                                <img src="./img/plantillaCertificado.png" alt="Fondo certificado">
                                <div class="datos">
                                <p id="nombre"><strong>${nombre}</strong></p>
                                <p id="cedula">${documento}</p>
                                <p id="tituloAsistio">Asisti al curso:</p>
                                <p id="descripcionCurso">Diseo y dimensionamiento de la infraestructura de soporte para el cumplimiento del Reglamento para redes internas de telecomunicaciones RITEL de acuerdo con la resolucin 5993 de 2020</p>
                                <p id="duracionCurso">El curso tuvo una duracin de treinta y cinco (35) horas, dictado en Febrero de 2022</p>
                                  <div class="capacitador">
                                      <img src="./img/firma.png" alt="Firma capacitador">
                                      <p id="nombreCapacitador"><strong>Ing. Marcos Quintana</strong><br>Capacitador</p>
                                  </div>
                                </div>
                                </section>`;

          cajaFila.innerHTML += templateCaja;
        }

        datosPersona.forEach((persona) =>
          crearCaja(
            persona.nombreEstudiante,
            persona.documento
          )
        );
          

        function crearPDF(baseCertificado, firmaTutor, nombreEst, docEstudiante, descCurso, duraCurso, nomCapacitador) {
          // Creacion del PDF
          const doc = new jsPDF({
            orientation: "landscape",
            unit: "px",
            format: [800, 618], // Respetando la relacion del certificado de 1.29449838 de ancho por alto (1.29 veces mas ancho que alto)
          });

          // Agregando imagenes en base64
          doc.addImage(baseCertificado, 0, 0, 800, 618);
          doc.addImage(firmaTutor, 500, 490, 60, 50);

          //Agregando texto con datos del certificado
          doc.setFont("times new roman");
          doc.setFontType("bold");
          doc.setFontSize(26);
          doc.text(nombreEst, 345, 255);

          doc.setFontType("");
          doc.setFontSize(22);
          doc.text("Documento No: " + docEstudiante.toString(), 345, 280);

          doc.setFontSize(18);
          doc.text("Asisti al curso:", 345, 320);

          doc.setFontSize(16);
          let descripcion = doc.splitTextToSize(descCurso, 400); // Debido a que la descripcion es tan larga, se hace necesario recortarla
          doc.text(descripcion, 345, 350);

          let duracion = doc.splitTextToSize(duraCurso, 400);
          doc.text(duracion, 345, 420);

          doc.text(nomCapacitador, 465, 565);

          doc.text("Capacitador", 490, 585);

          doc.save("certificado " + nombreEst + ".pdf");
        }

        // Creacion de los diferentes certificados, uno por uno
        datosPersona.forEach((personaCertificado) =>
          crearPDF(
            fondoCertificado,
            firmaCapactador,
            personaCertificado.nombreEstudiante,
            personaCertificado.documento,
            descripcionCurso,
            duracionCurso,
            nombreCapacitador
          )
        );
        

        // deshabilita boton de generar certificados para evitar descargar duplicados
        generarCertificado.disabled = true;
      }




      
    };
  }
  botonConvertir.disabled = true;
});